import styled from "styled-components";

export const StyledSectionLogin = styled.section`
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  & > div:first-child {
    margin-top: 25px;
    margin-bottom: 30px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 20%;

    img {
      height: 21.211807250976562px;
      width: 122.05999755859375px;
    }
  }
`;
